	// 解析websocket接口json数据
	private static void parseFlightJSONData(String jsonData) {
		JSONObject jsonObject = JSONObject.parseObject(jsonData);
		int totalPages = jsonObject.getJSONObject("data").size();
		for (int i = 0; i < totalPages; i++) {
			JSONArray list = jsonObject.getJSONObject("data").getJSONObject("p" + i).getJSONArray("list");

			for (int j = 0; j < list.size(); j++) {
				System.out.print(list.getJSONObject(j).getString("planTime") + "\t");
				JSONArray flightNoData = list.getJSONObject(j).getJSONArray("flightNoData");
				for (int k = 0; k < flightNoData.size(); k++) {
					if (k == flightNoData.size() - 1) {
						System.out.print(flightNoData.getJSONObject(k).getString("flightNo"));
					} else {
						System.out.print(flightNoData.getJSONObject(k).getString("flightNo") + "|");
					}
				}
				System.out.print("\t"+list.getJSONObject(j).getString("toCityZH") + "\t");
				System.out.print("\t"+list.getJSONObject(j).getString("checkinArea") + "\t");
				System.out.print("\t"+list.getJSONObject(j).getString("statusZH") + "\t");
				System.out.println();
			}
		}

	}
	public static String getJSONDataVersion(String jsonData) {
		JSONObject jsonObject = JSONObject.parseObject(jsonData);
		String version=jsonObject.getString("version");
		return version;
	}
